import React, { useState } from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  height: 100vh;
  background-color: #f5f5f5;
`;

const MapContainer = styled.div`
  flex: 1;
  height: 100%;
  position: relative;
  background-color: white;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
`;

const MapFrame = styled.iframe`
  width: 100%;
  height: 100%;
  border: none;
`;

const Sidebar = styled.div`
  width: 400px;
  padding: 20px;
  background-color: white;
  box-shadow: -2px 0 10px rgba(0, 0, 0, 0.1);
  overflow-y: auto;
`;

const Title = styled.h1`
  color: #333;
  margin-bottom: 20px;
  font-size: 24px;
`;

const Input = styled.textarea`
  width: 100%;
  height: 100px;
  padding: 10px;
  margin-bottom: 20px;
  border: 1px solid #ddd;
  border-radius: 4px;
  resize: vertical;
  font-family: inherit;
  &:focus {
    outline: none;
    border-color: #4a6cf7;
  }
`;

const Button = styled.button`
  width: 100%;
  padding: 12px;
  background-color: #4a6cf7;
  color: white;
  border: none;
  border-radius: 4px;
  cursor: pointer;
  font-weight: bold;
  transition: background-color 0.2s;
  &:hover {
    background-color: #3451b2;
  }
  &:disabled {
    background-color: #ccc;
    cursor: not-allowed;
  }
`;

const Analytics = styled.div`
  margin-top: 20px;
  padding: 15px;
  background-color: #f8f9fa;
  border-radius: 4px;
`;

const LoadingOverlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: rgba(255, 255, 255, 0.8);
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 18px;
  color: #333;
`;

function App() {
  const [prompt, setPrompt] = useState('');
  const [loading, setLoading] = useState(false);
  const [mapHTML, setMapHTML] = useState("http://127.0.0.1:5000/maps/filtered_map.html");
  const [mapLoading, setMapLoading] = useState(false);
  const [mapError, setMapError] = useState(null);
  const [analytics, setAnalytics] = useState({
    summary: '',
    count: 0,
    logs: [],
    visualization: null
  });

  const handlePromptSubmit = async () => {
    if (!prompt.trim()) return;

    setLoading(true);
    setMapLoading(true);
    setMapError(null);

    try {
      const response = await fetch('http://127.0.0.1:5000/process-prompt', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ prompt: prompt.trim() })
      });

      const data = await response.json();

      if (data.error) {
        console.error('Error:', data.error);
        setMapError(data.error);
        setLoading(false);
        setMapLoading(false);
        return;
      }

      setAnalytics({
        summary: data.summary,
        count: data.count,
        logs: data.logs,
        visualization: data.visualization
      });

      // Update map URL with timestamp to force refresh
      const timestamp = Date.now();
      const newMapUrl = `http://127.0.0.1:5000/maps/${data.filteredMap}?t=${timestamp}`;
      setMapHTML(newMapUrl);

    } catch (error) {
      console.error('Error:', error);
      setMapError('Failed to process request');
    } finally {
      setLoading(false);
      setMapLoading(false);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      handlePromptSubmit();
    }
  };

  return (
    <Container>
      <MapContainer>
        {mapLoading && (
          <LoadingOverlay>Loading map...</LoadingOverlay>
        )}
        {mapError ? (
          <LoadingOverlay>{mapError}</LoadingOverlay>
        ) : (
          <MapFrame
            src={mapHTML}
            title="Interactive Map"
            onLoad={() => setMapLoading(false)}
          />
        )}
      </MapContainer>
      <Sidebar>
        <Title>City Talks</Title>
        <Input
          value={prompt}
          onChange={(e) => setPrompt(e.target.value)}
          onKeyPress={handleKeyPress}
          placeholder="Enter your query (e.g., 'Show houses under 350k' or 'Find restaurants in Eixample')"
        />
        <Button 
          onClick={handlePromptSubmit}
          disabled={loading || !prompt.trim()}
        >
          {loading ? "Processing..." : "Search"}
        </Button>
        {analytics.summary && (
          <Analytics>
            <h3>Results</h3>
            <p>{analytics.summary}</p>
            <p>Found: {analytics.count} matches</p>
            {analytics.visualization && (
              <div>
                <h4>{analytics.visualization.title}</h4>
                <img 
                  src={`data:image/png;base64,${analytics.visualization.data}`}
                  alt="Data visualization"
                  style={{ width: '100%', marginTop: '10px', borderRadius: '4px' }}
                />
              </div>
            )}
          </Analytics>
        )}
      </Sidebar>
    </Container>
  );
}

export default App;
